import React, { Component } from 'react';
import { Route, NavLink, HashRouter } from 'react-router-dom';
import SiteHeader from './components/SiteHeader';
import HomepageImage from './components/HomepageImage';
import { Scroll, Element } from 'react-scroll';
import Home from './components/Home';
import About from './components/About';
import Projects from './components/Projects';
import Contact from './components/Contact';
import More from './components/More';

const ScrollLink = Scroll.ScrollLink;

class App extends Component {

  render() {
    return (
      <HashRouter>
        <div>
          <h1>Charlie Leopard</h1>
          <ul className='header'>
            <li><ScrollLink exact to="/">Home</ScrollLink></li>
            <li><ScrollLink to="/about">About me</ScrollLink></li>
            <li><ScrollLink exact to="/projects">Projects</ScrollLink></li>
            <li><ScrollLink to="/contact">Contact</ScrollLink></li>
            <li><ScrollLink exact to="/more">More</ScrollLink></li>
          </ul>

          <Element id='/' name='/'>
            <Home />
          </Element>
          <Element id='/' name='/'>
            <About />
          </Element>
          <Element id='/' name='/'>
            <Projects />
          </Element>
          <Element id='/' name='/'>
            <Contact />
          </Element>
          <Element id='/' name='/'>
            <More />
          </Element>






          <div className="content">
            <Route exact path="/" component={Home} />
            <Route path="/about" component={About} />
            <Route path="/contact" component={Contact} />

          </div>
        </div>
      </HashRouter>
    );
  }
}

export default App;
